import React, { Component } from 'react';
import Contacts from './components/contacts';
import Nodes from './components/nodes';

class App extends Component{

  componentDidMount() {
    fetch('http://84.88.185.94:5002/graph/a22l')
    .then(res => res.json())
    .then((data) => {
      this.setState({ contacts: data['edges'], nodes : data['nodes'] })
    })
    .catch(console.log)
  }

  state = {
    contacts: [],
    nodes: []
  }

  render() {
    return (
      <div>
        <Contacts contacts={this.state.contacts} />
        <Nodes nodes={this.state.nodes} /> 
      </div>      
    );
  }
}

export default App;
